s a fim de\ngarantir o melhor resultado voltado para a organização. *','Ativo'),(272,4,14,12,'Refere-se à empresa como \"nós\". Demonstra brilhos nos olhos por fazer parte do\ntime e transmite engajamento para a equipe. *','Ativo'),(273,4,14,13,'Pensa e atua levando em consideração a ótica do cliente e da empresa. \"Veste a\ncamisa\" e coloca-se no lugar da empresa, demonstrando preocupação sobre a\nforma como ela será enxergada pelo cliente e pelo mercado. *','Ativo'),(274,4,14,14,'Fomenta uma boa imagem da empresa interna e externamente. Propõe\nmelhorias e aponta soluções com responsabilidade. *','Ativo'),(275,4,14,15,'Demonstra atitude enérgica e dinâmica durante o trabalho. Antecipa-se aos\npossíveis problemas antes que aconteçam. É proativo e tem muita iniciativa. *','Ativo'),(276,4,14,16,'Cumpre prazos e responde prontamente às demandas que lhe são passadas.\nNão deixa nada para a última hora. *','Ativo'),(277,4,14,17,'Faz primeiro o que é mais urgente, antes que se torne um problema. Faz o que\nprecisa ser feito, de forma ágil e dinâmica. *','Ativo'),(278,4,14,18,'Colabora para um bom clima e relacionamento da equipe. Trata aos colegas com\nrespeito, educação e empatia. *','Ativo'),(279,4,14,19,'Orienta de forma assertiva as pessoas da equipe quando necessário, a fim de\ntratar e/ou apurar inconsistências. *','Ativo'),(280,4,14,20,'Presta suporte à equipe ao auditar e acompanhar a produção se fazendo\npresente e próximo quando necessário. *','Ativo');
